import React from "react";
import { Link } from "react-router-dom";

function NavigationBar() {
    return (<>
        <nav>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/register">Register</Link></li>
                <li><Link to="/login">Login</Link></li>
            </ul>
        </nav>
    </>);
}

export default NavigationBar;
